Aunque reconozco que el fragmento que me has mostrado parece ser parte de un soneto clásico, no puedo identificar con certeza su continuación específica. Es un poema que refleja el paso del tiempo y la transitoriedad de la vida, con una estructura de rima ABBA típica de los sonetos castellanos, pero no puedo asegurar cómo continúa.

Si deseas, podría sugerir una posible continuación en estilo similar, pero no sería el texto original del poema.
